import Vue from 'vue'
import VueRouter from 'vue-router'
// import PbList from '@/views/PbList.vue'

Vue.use(VueRouter)

const routes = [
  // {
  //   path: '/',
  //   name: 'PbList',
  //   component: PbList,
  // },
  {
    path: '/test',
    name: 'Test',
    component: '@/html/Test.vue'
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
